export const Word = (props) => {
  return (
    <div className="flex flex-col justify-center h-64 border bg-white relative" onClick={props.onClick}>
      <div className="reborder h-64 basis-1/2 right-0 bg-black"></div>
      <div className="border h-64 basis-1/2 left-0 bg-red-500"></div>
      <div className='flex flex-col items-center bg-white'>
        <div>{props.word.title}</div>
        <div>{props.word.text}</div>
      </div>
    </div>
  );
}
